script: |
  super -f text -I q12805.spq | sort > q12805.out

inputs:
  - name: q12805.spq
    data: |
      SELECT + col0 * + - col2 / + col2 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN - 22 + - + ( - + col0 ) AND + 97;
  - name: tab0

outputs:
  - name: q12805.out
    data: |
